import React from "react";
import UserLayout from "../../../packages/userLayout/UserLayout";
import DeleteModal from "../../recipes/userProfileList/components/DeleteModal";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faTrash } from "@fortawesome/free-solid-svg-icons";

const ContactsList = (props) => {
  return (
    <div className="page_wrapper">
      <UserLayout>
        <h2 className="emails_list_title">Контакти</h2>
        <table className="email">
          <thead>
            <tr>
              <th>#</th>
              <th>Име</th>
              <th>Фамилия</th>
              <th>Телефон</th>
              <th>Имейл</th>
              <th>Опции</th>
            </tr>
          </thead>
          <tbody>
            {emails.map((email, index) => {
              return (
                <tr style={{ fontSize: 20, padding: 15 }} key={index}>
                  <td> {index + 1}</td>
                  <td>{email.email}</td>
                  <td>
                    <FontAwesomeIcon
                      onClick={() => toggleDeleteModal(email.email)}
                      className="delete"
                      icon={faTrash}
                    />{" "}
                  </td>
                </tr>
              );
            })}
          </tbody>
        </table>
        {success && (
          <p style={{ textAlign: "right" }} className="success">
            {success}
          </p>
        )}
      </UserLayout>
      {isOpenDeleteModal === true && (
        <DeleteModal
          isModalOpen={isOpenDeleteModal}
          closeModal={() => toggleDeleteModal(selectedEmailToDelete)}
          deleteTask={() => deleteEmail(selectedEmailToDelete)}
        />
      )}
    </div>
  );
};

export default ContactsList;
